pragma solidity ^0.8.0;
// pragma use to specify which version is this




contract Mycoin{

    uint value;
    // a is state variable and it stores on blockchain
    // state variable stores on blockchain 

// this are fixed typed variable
    bool isReady;

    address recipient;
    bytes32 data;  // can hold binary data

    // variable size type
    string name;
    uint val = 10;
    uint[] amounts;
    mapping(uint => string) users;



    // user define data
    struct User{
        uint id;
        string name;
        uint[] friends;
    }

    enum Color{
        RED,
        GREEN,
        BLUE
    }

    // To manipulate data we need function
    function getValue() pure public returns(uint){
        uint age = 10;

        return age;

        // local variables are declare inside function body and they store in stack 
    }

    function getter() public view returns(uint)  {
        return val;

        // view means only readable not writable so dont have to pay gas price
    }

    function setter(uint nNum) public {
        val += nNum;
    }



    
    // define contract by using contract keyword
}

